		<h1>66 尻奴隷</h1>

		<table width="760">
			<tr>
				<td>
					<p>　艶かしく揺れる豊かな双臀…、クチュクチュといやらしい音を奏でる淫らな肛門…、溢れる出る妖しい疼き…<br>
						「お尻で感じる変態尻奴隷……」<br>
						　愛弟子達の目の前で繰り返し浅ましい恥態を晒し被虐の快美に溺れるアニスは、自ら向かってそう問いかけた。</p>
